BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `regions` (
	`id`	INTEGER,
	`nom`	TEXT,
	PRIMARY KEY(`id`)
);
CREATE TABLE IF NOT EXISTS `departements` (
	`id`	INTEGER,
	`reg`	INTEGER,
	`nom`	TEXT
);
CREATE TABLE IF NOT EXISTS `communes` (
	`id`	INTEGER,
	`dep`	INTEGER,
	`nom`	TEXT,
	`pop`	INTEGER,
	PRIMARY KEY(`id`)
);
COMMIT;
